import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import Fab from '@mui/material/Fab';
import AddIcon from '@mui/icons-material/Add';
import FormDialog from './FormDialog'; // Import the dialog component

const Notes = () => {
  const [openDialog, setOpenDialog] = useState(false); // State for dialog visibility

  const handleOpenDialog = () => {
    setOpenDialog(true);
  };

  const handleCloseDialog = () => {
    setOpenDialog(false);
  };

  return (
    <>
      <div style={{ display: "flex", justifyContent: "space-between" }}>
        <h1>Notes</h1>
        <Fab color="primary" aria-label="add" onClick={handleOpenDialog}>
          <AddIcon />
        </Fab>
      </div>
      <div style={{ display: "flex", flexDirection: "column", justifyContent: "space-evenly", height: 500, alignItems: "center" }}>
        <Link to="/notes/1" style={{ textDecoration: 'none' }}>
          <button style={{ height:30,width: 100, cursor: "pointer" }}>note1</button>
        </Link>
        <Link to="/notes/2" style={{ textDecoration: 'none' }}>
          <button style={{ height:30, width: 100, cursor: "pointer" }}>note2</button>
        </Link>
        <Link to="/notes/3" style={{ textDecoration: 'none' }}>
          <button style={{ height:30, width: 100, cursor: "pointer" }}>note3</button>
        </Link>
        <Link to="/notes/4" style={{ textDecoration: 'none' }}>
          <button style={{ height:30, width: 100, cursor: "pointer" }}>note4</button>
        </Link>
      </div>

      {/* Render the FormDialog component */}
      <FormDialog open={openDialog} handleClose={handleCloseDialog} />
    </>
  );
};

export default Notes;
